```

```
apt-get install nginx
rm -rf /etc/nginx/nginx.conf
vi/whatever text editor /etc/nginx/nginx.conf
```

then in another screen take this nginx conf

```
user www-data;
worker_processes 1;
pid /run/nginx.pid;
include /etc/nginx/modules-enabled/*.conf;

events
{
    worker_connections 20000;
}

worker_rlimit_nofile 40000;

http
{
    ignore_invalid_headers off;
    client_max_body_size 0;
    proxy_intercept_errors on;

    map $server_port $backend_port {
        30001 3001;
        30002 3002;
    }

    server {
        proxy_http_version 1.1;
        access_log /var/log/nginx/access.log proxylog;
        listen 30001;
        listen 30002;

        location / {
            proxy_pass http://127.0.0.1:$backend_port;
        }
    }
}
```

and edit your ports in it instead of my 30001 and 30002 and you'll listen on those. on runpod, look at your ports (provided you created the instance with them), and just add them how ever many there are (usually correlates with how many miners you have if you're doing 1 miner per port)

save the file and start nginx `nginx` (or use pm2), and run `nginx -s reload` just in case

then when you go to start the miner, the only trick here is using `axon.external_port` and `axon.port` in your miner arguments

heres an example:

```
pm2 start /usr/src/SocialTensorSubnet/main_env/bin/python --name "miner24" -- -m neurons.miner.miner --axon.external_port 30001 --axon.port 3001 ... other args
```

